INSERT INTO "TruyenCuoiConTrai" VALUES(X'','Bí kíp võ công','Có 1 anh chàng một hôm đang đi nhặt lá đá ống bơ thì nhặt được 1 quyển bí kíp.

Nghi là võ học thượng thừa nên anh ta giấu mang về nhà đọc.

Trang 1 : Miêu tả về võ công. Có thể hô mưa gọi gió. Độc bộ thiên hạ. Đưa người ta lên đỉnh cao của võ học.

Trang 2 : Cần phải tự cung mới có thể luyện …

Sau một hồi đắn đo suy nghĩ. Anh ta hạ quyết tâm vung đao tự cung.

Xong việc anh nén đau đọc tiếp bí kíp

Trang 3 : .. không tự cung cũng không sao …

Anh ta điên cuồng. Nổi lửa lên đốt ngay quyển bí kíp.

Khi sách cháy gần hết. Trang cuối quyển bí kíp bay ra ,chàng trai đưa mắt nhìn

Trang cuối : Nếu đã tự cung thì sau khi luyện thành bí kíp của quý sẽ mọc lại …','Truyện Cười Con Trai');
INSERT INTO "TruyenCuoiConTrai" VALUES(X'','Chơi khó bạn','Anh chàng hết tiền liền nhắn tin cho bạn thân: "Mày làm gì đấy? Mua cho tao cái thẻ!"

Thằng bạn ngay lập tức nhắn tin lại:

- Mã thẻ này nạp đi! Tao nạp thử rồi! Được đấy!','Truyện Cười Con Trai');
INSERT INTO "TruyenCuoiConTrai" VALUES(X'','Dẻo mồm','Vợ cằn nhằn chồng:
- Sao sáng nào anh cũng đi cà phê, trưa thì đọc báo, tối lại đi nhậu hết vậy?
- Anh làm vậy vì em thôi.
- Tại sao lại vì em?
- Anh đi cà phê thì mới có tin tức thời sự kể cho em nghe, anh đọc báo để biết shop thời trang, mỹ phẩm nào giảm giá, khuyến mãi cho em chứ.
- Chứ còn anh đi nhậu?
- Để khi nhậu về, anh thấy em thật quyến rũ và dịu dàng.','Truyện Cười Con Trai');
INSERT INTO "TruyenCuoiConTrai" VALUES(X'','Không cần đăng ký','Một anh chàng kỹ sư tin học đang ngồi chơi với người yêu trước màn hình máy tính. Cô nàng nũng nịu, còn chàng kỹ sư thì mặt dán vào màn hình, tay gõ bàn phím lách cách.

Cô gái thỏ thẻ:

- Bao giờ thì chúng mình đăng ký đây? Em không thể chờ đợi thêm nữa!

Chàng trai nhẹ nhàng đáp:

- Yên tâm đi cưng! Cần gì phải đăng ký, anh sắp bẻ khóa xong rồi mà!','Truyện Cười Con Trai');
INSERT INTO "TruyenCuoiConTrai" VALUES(X'','Rét thì thôi','- Tớ chẳng thấy nhà cậu có buồng tắm. Cậu tắm rửa ở đâu?

- Ra ngoài sông.

- Thế mùa rét thì sao?

- Mùa đông thì cũng chỉ vài tháng chứ mấy!','Truyện Cười Con Trai');
