INSERT INTO "TruyenCuoiCongNghe" VALUES(X'','Cứ tưởng bị chửi khéo','Một anh chàng kỹ sư tin học đi cài máy tính đến công đoạn phải đăng nhập vào máy bèn hỏi khách: "Mật khẩu máy anh là gì thế?"

- Ngu thì đừng có hỏi.

- ????? (Mặt hầm hầm)

- Không hiểu à? Mật khẩu máy tôi đó.

- Phù! Tôi cứ tưởng!

','Truyện Cười Công Nghệ');
INSERT INTO "TruyenCuoiCongNghe" VALUES(X'','Tin nhắn shock','Có một chàng trai yêu đơn phương một cô gái nhưng không dám nói ra.

Một ngày kia, lấy hết can đảm, chàng soạn một tin nhắn tỏ tình và nhấn send lúc 1h sáng. Tin nhắn trả lời đến ngay sau đó, nhưng chàng trai quyết định để ngày hôm sau sẽ đọc.

Sáng hôm sau, chàng trai mở tin nhắn lên và... shock.

"Tài khoản của bạn không đủ để gửi tin nhắn, xin vui lòng nạp thêm!"','Truyện Cười Công Nghệ');
INSERT INTO "TruyenCuoiCongNghe" VALUES(X'','Dân IT tuyển vợ','Yêu cầu phần cứng:

- Chạy nhanh, bền, tốt, kích cỡ nhỏ gọn, thiết kế trang nhã
- Còn nguyên tem bảo hành, không được trầy xước dù là vết nhỏ
- Tương thích dễ dàng với các thiết bị ngoại vi như: bếp, chổi quét nhà…
- Hoạt động tốt trong môi trường như chợ, siêu thị…...','Truyện Cười Công Nghệ');
