INSERT INTO "TruyenCuoiDanGian" VALUES(X'','Mẹo vặt','Ông chủ đoàn xiếc nhìn thấy màn biểu diễn đặc sắc trên đường phố: Một con vịt nhảy nhót trên chiếc nồi úp ngược. Ông ngạc nhiên vô cùng và bèn trả khoản tiền lớn để mua con vịt cùng chiếc nồi.

Chỉ một ngày sau, ông ta tức giận tìm tới chỗ người bán vịt:

- Tôi để con vịt lên chiếc nồi và làm hết cách rồi mà nó cứ đứng đực ra, không chịu nhảy nhót gì cả!

- Thế à? - người chủ cũ con vịt đáp lại - Thế ông có nhớ đốt nến dưới chiếc nồi không?','Truyện Cười Dân Gian');
INSERT INTO "TruyenCuoiDanGian" VALUES(X'','Chí Phèo biết chữ','Sang nhà Bá Kiến ăn vạ xong, Chí Phèo xách một can rượu 20 lít “chiến lợi phẩm” lặc lè lết về vườn chuối. Vừa đi gã vừa lẩm bẩm:

- Mẹ cha cái lão Bá Kiến, rượu nặng thế này mà lão ấy kêu rượu nhẹ, định làm mình say chết đây!

Rồi hắn bập bẹ đánh vần:

- Rờ... ươu... rươu... nặng... rượu. Nhờ... e... nhe... nặng... nhẹ... Hừ! Làm chó gì có cái thứ đã nặng lại còn nhẹ. Mẹ cha nó! Cái làng Vũ Đại này loạn rồi.','Truyện Cười Dân Gian');
INSERT INTO "TruyenCuoiDanGian" VALUES(X'','Tốc độ phát triển các nước','Trong một cuộc thi về tốc độ phát triển các nước trên thế giới , Có 3 nước tham gia là Mỹ , Nhật và Việt Nam.

Nước Mỹ lên tiếng trước...

- "Nước tôi là số 1, Nếu chúng tôi đào xuống đất 10m thì phát hiện ra dây điện ngầm...trong khi các anh còn chưa có dây điện trần.Nguồn điện bắt đầu từ đó."

- Nước Nhật tức giận..."Như thế mà cho là phát triển hả? Nếu như chúng tôi đào xuống 50m thì đó là nơi chúng tôi chôn dây cáp quang...Đó là lúc internet xuất hiện đầu tiên."

Đến lượt Việt Nam: Loay hoay mãi chẳng biết làm sao? Nhưng vì cuộc thi nên cũng phải đào... Đào mãi , đào mãi chẵng thấy dây gì..Suy nghĩ một hồi rồi trịnh trọng tuyên bố:

- "Các nước mấy chú còn lạc hậu quá.! Chúng tôi đào hoài mà không thấy gì chứng tỏ lúc bấy giờ nước tôi đã bắt đầu dùng wireless (không dây)..."','Truyện Cười Dân Gian');
INSERT INTO "TruyenCuoiDanGian" VALUES(X'','Ai nịnh ai?','Một anh nhà giàu hỏi người nghèo:

- Tôi giàu anh có nịnh tôi không?

Người nghèo:

- Ông giàu mắc mớ gì đến tôi mà tôi phải nịnh ông?

Nhà giàu:

- Nếu tôi cho anh nửa gia tài, anh có nịnh tôi không?

Người nghèo:

- Lúc đó tôi giàu bằng ông rồi việc gì tôi phải nịnh ông.

Nhà giàu:

- Nếu tôi cho anh cả gia tài, anh  có nịnh tôi không?

Người nghèo:

- Chắc chắn lúc đó ông phải nịnh tôi.','Truyện Cười Dân Gian');
INSERT INTO "TruyenCuoiDanGian" VALUES(X'','Chả dấu gì bác','Có một ông lâu ngày đến nhà ông bạn thân chơi. Khách chủ gặp nhau chuyện trò rôm rả. Chủ kiếm trầu mời khách nhưng giữa cơi trầu chỉ có mỗi một miếng. Chủ khẩn khoản mời mãi, khách đành phải ăn.

Cách một thời gian sau, ông này nhớ bạn lại đánh đường sang thăm trả.

Thấy bạn đến, ông kia mừng lắm, mời lên nhà ngồi. Chuyện trò lại rôm rả.

Ông này cũng bày ra giữa cơi chỉ có mỗi một miếng trầu và khẩn khoản mời.

Ông khách khen cơi trầu đẹp và nể lời cầm miếng trầu lên tay ngắm nghía:

- Thứ cau của nhà bác chắc bổ vào dịp trời mưa nên nó lắm xơ nhỉ?

- Không đâu ạ, đó chính là miếng trầu bác mời dạo nọ đấy ạ. Tôi ngậm nên nó hơi bị giập ra.','Truyện Cười Dân Gian');
INSERT INTO "TruyenCuoiDanGian" VALUES(X'','Dẻo và bền nhất','- Thầy: Trò nghe đây: sắt thép, đồng…vật liệu nào dẻo dai và bền nhất?
- Quỳnh: Thưa thầy là…Thưa thầy cho 5 phút suy nghĩa ạ. Á! Thưa thầy vật dẻo dai và bền nhất đó là sợi tóc ạ.
- Thầy: Sao! Làm gì có chuyện đó sợi tóc làm sao có thể dẻo hơn sắt thép được?
- Quỳnh: Sao lại ko ạ! Thưa thầy chẳng phải người ta nói nghìn cân treo sợi tóc đó thôi ạ.','Truyện Cười Dân Gian');
INSERT INTO "TruyenCuoiDanGian" VALUES(X'','Ít ngủ','- Thầy: Trò nghe đây: sắt thép, đồng…vật liệu nào dẻo dai và bền nhất?
- Quỳnh: Thưa thầy là…Thưa thầy cho 5 phút suy nghĩa ạ. Á! Thưa thầy vật dẻo dai và bền nhất đó là sợi tóc ạ.
- Thầy: Sao! Làm gì có chuyện đó sợi tóc làm sao có thể dẻo hơn sắt thép được?
- Quỳnh: Sao lại ko ạ! Thưa thầy chẳng phải người ta nói nghìn cân - Cha: Dạo này con thức khua quá! Ít ngủ ko có lợi đâu, con ạ!
- Quỳnh: Cha đừng lo, con đã ngủ bù ở lớp rồi ạ!
- Cha: Trời !!!','Truyện Cười Dân Gian');
INSERT INTO "TruyenCuoiDanGian" VALUES(X'','Uống nước nhớ...','- Thầy: Uống nước nhớ gì, em nào biết!
- Quỳnh: Dạ thưa thầy, uống nước kẻ trồng cây!
- Thầy: Sao lại uống nước nhớ kẻ trồng cây?
- Quỳnh: Dạ , vì em uống nước dừa mà thầy!','Truyện Cười Dân Gian');
INSERT INTO "TruyenCuoiDanGian" VALUES(X'','Thành thật','- Mẹ: Con ăn vụng canh phải không?
