- Mắm: Hừ! Biết ngay mà!','Truyện Cười Dân Gian');
INSERT INTO "TruyenCuoiDanGian" VALUES(X'','Khen khéo','- Mắm : Nè, ông thấy tôi mặc cái áo mới này như thế nào?
