- Mắm: (suy sụp)!??','Truyện Cười Dân Gian');
INSERT INTO "TruyenCuoiDanGian" VALUES(X'','Chó treo mèo đậy','- Mợ: Con ở nhà trông mâm cơm. Nhớ là chó treo mèo đậy đấy. Mợ phải đi đàng này một lát.
Một lát sau…
- Mợ: Thế nào xong chưa con?
- Quỷnh: Dạ xong rồi ạ! Mợ bảo chó treo mèo đậy nên con treo chó và đậy mèo mà!','Truyện Cười Dân Gian');
DROP TABLE IF EXISTS "TruyenCuoiGiaDinh";
CREATE TABLE "TruyenCuoiGiaDinh" ("ImageStory" BLOB NOT NULL , "Title" VARCHAR NOT NULL , "Content" VARCHAR NOT NULL , "Topic" VARCHAR DEFAULT null);
INSERT INTO "TruyenCuoiGiaDinh" VALUES(X'','Điều ước khó khăn','Một gia đình đang lái xe trên đường thì con cóc nhảy ngang qua. Ông chồng thắng xe kip thời, bước xuống, mang con cóc đặt qua vệ đường.

Con cóc bỗng nói:

- Cám ơn ông đã cứu mạng. Tôi sẽ cho gia đình ông một điều ước!

Người đàn ông nói:

- Vậy hãy làm cho con chó của tôi thắng cuộc đua hôm nay?

Ông ta gọi con chó ra, và khi thấy nó chỉ có ba chân, con cóc nói:

- Khó quá... Hay ông xin điều khác đi!

Lúc đó bà vợ trong xe bước ra và nói:

- Vậy hãy làm cho tôi thắng cuộc thi hoa hậu năm nay được không?

Cóc nhìn bà vợ rồi quay lại nói với ông chồng:

- Ông... cho tôi xem lại con chó, tôi sẽ cố gắng.','Truyện Cười Gia Đình');
INSERT INTO "TruyenCuoiGiaDinh" VALUES(X'','Đồng cảm','Gia đình nọ có bà mẹ ghê gớm, áp đặt lên cậu con trai từ chuyện học hành tới tình cảm riêng tư. Con giun xéo lắm cũng oằn, một hôm giữa bữa ăn, cậu buông đũa đứng dậy:

- Con không thể chịu nổi mẹ nữa, con sẽ ra đi.

Ông bố thấy thế vội lớn tiếng:

- Thằng kia....

- Bố đừng cản con!

- Không. Cho tao theo với.','Truyện Cười Gia Đình');
INSERT INTO "TruyenCuoiGiaDinh" VALUES(X'','Tưởng bở','Chàng trai hỏi cô gái: "Em yêu, nếu anh cưới em thì bố mẹ sẽ mua xe hơi đời mới cho anh chứ?"

- Vâng.

- Bố em sẽ mua nhà cho chúng mình chứ?

- Vâng.

- Và bố em sẽ cho anh làm phó giám đốc công ty của ông ấy chứ?

- Vâng.

- Em yêu, em đồng ý lấy anh chứ?

- Không.','Truyện Cười Gia Đình');
INSERT INTO "TruyenCuoiGiaDinh" VALUES(X'','Không thuộc loại nào','Cô gái nói với chồng sắp cưới: "Trên đời này chỉ có hai loại đàn ông thôi anh ạ".

- Loại thứ nhất đi nhậu bia ôm nhưng còn biết hối hận với vợ, với con. Loại thứ hai là đi nhậu mà không thèm hối hận, cắn rứt gì cả... Thế anh thuộc loại nào?

- Anh á, anh thuộc dạng không đi bia ôm nhưng hối hận.','Truyện Cười Gia Đình');
INSERT INTO "TruyenCuoiGiaDinh" VALUES(X'','Bố vợ và con rể','Hai người bạn ngồi hàn huyên tâm sự với nhau ngoài quán nhậu. Một anh hỏi: "Quan hệ giữa cậu và ông bố vợ ra sao?".

- Rất tốt! Tôi với ông ấy khá hợp nhau, trừ một lần duy nhất, tôi không hiểu ý ông ấy.

- Lần nào vậy?

- Lúc tôi xin cưới, ông ấy can ngăn và nói làm thế vì rất thương tôi. Thế mà tôi lại không tin.','Truyện Cười Gia Đình');
INSERT INTO "TruyenCuoiGiaDinh" VALUES(X'','Cẩn thận vẫn hơn','Một ông cụ vào nhà ga xe lửa trong làng và đi đến quầy vé, hỏi nhân viên nhà ga.

- Này cậu, chuyến tàu lúc 3 giờ 10 phút đã đi chưa?

- Đã rời ga cách đây 15 phút.

- Còn bao lâu nữa chuyến 4 giờ mới đến?

- Còn lâu lắm.

- Vậy trước đó còn chuyến tàu khách nào không?

- Không.

- Tàu chở hàng?

- Không.

- Không có chuyến nào hết?

- Hoàn toàn không?

- Anh có chắc không?

- Chắc chứ! - nhân viên bán vé nổi nóng.

- Vậy thì, mình ơi - ông quay sang gọi bà vợ - bây giờ chúng ta có thể đi ngang qua đường ray được rồi.','Truyện Cười Gia Đình');
INSERT INTO "TruyenCuoiGiaDinh" VALUES(X'','Sức mạnh của đồng tiền','Trong quá trình tiến hành tập sự cho hôn lễ, chú rể bí mật tiếp cận vị mục sư và đưa ra lời đề nghị.

- Tôi sẽ đổi 100 đô la lấy việc bỏ các từ ''yêu thương, tôn trọng, vâng lời và chung thủy với cô ấy mãi mãi'' trong lời thề kết hôn.

Vị mục sư đồng ý và nhận lấy 100 đô la với vẻ hài lòng.

Hôm sau, vào buổi lễ chính thức, vị mục sư nhìn thẳng vào mắt chàng trai, mỉm cười nhẹ nhàng và chậm rãi nói:

- Chàng trai, bạn có hứa sẽ luôn sẵn sàng phủ phục mình trước mặt cô gái đứng trước mặt đây, vâng theo mỗi mệnh lệnh của cô ấy, mang đồ ăn sáng đến bên giường cô ấy vào mỗi buổi sáng trong suốt cuộc đời sau này của bạn. Đồng thời thề trước mặt Chúa sẽ không bao giờ thèm nhìn bất kỳ người phụ nữ nào khác cho đến khi cả hai không còn trên cõi đời này nữa không?

Chú rể nuốt nước bọt và nhìn xung quanh, đáp lại bằng một giọng rất nhỏ nhẹ:

- Vâng.

Sau nghi thức, chàng trai ngay lập tức bám chặt lấy vị mục sư và rít lên:

- Tôi nghĩ chúng ta đã có một thỏa thuận?

Lúc này, vị mục sư mới đặt lại vào tay chú rể tờ tiền cũ và thì thầm:

- Cô ấy đã đưa ra một lời đề nghị tốt hơn.','Truyện Cười Gia Đình');
INSERT INTO "TruyenCuoiGiaDinh" VALUES(X'','Ruồi đực, ruồi cái','Một người phụ nữ đi về nhà và thấy ông chồng đang đi loanh quanh với một cái vỉ đập ruồi trên tay. Cô hỏi: "Anh đang làm gì vậy?".

- Săn ruồi!

- Ồ, thế đã giết được con nào chưa?

- Rồi, ba con đực, hai con cái!

- Sao anh biết con nào đực, cái?

- Ba con bò trên can bia, hai con đậu ở điện thoại.','Truyện Cười Gia Đình');
INSERT INTO "TruyenCuoiGiaDinh" VALUES(X'','Đánh thức','Hai vợ chồng nhà kia cãi nhau, giận nhau, không ai nói với ai một câu nào.

Trước khi đi ngủ, người chồng viết một mảnh giấy ném cho vợ:

- "Sáng mai đánh thức tôi dậy lúc 5h, tôi có việc quan trọng phải làm".

Hôm sau người chồng thức dậy lúc 7h.

Ông ta tìm thấy một mảnh giấy ghi:

- "5h rồi, dậy đi".','Truyện Cười Gia Đình');
INSERT INTO "TruyenCuoiGiaDinh" VALUES(X'','Có phải con tôi không?','Một ông lão bệnh nặng sắp lên thiên đàng mà trong lòng còn nghi vấn bèn hỏi bà vợ:

- Tôi sắp chết rồi nhưng muốn biết một sự thật là thằng Út có phải là con của tôi không?

Bà vợ trả lời:

- Ông sắp lên thiên đàng rồi thì tui cũng không giấu làm gì, trong 4 đứa con, chỉ có thằng Út là con ông.

Ông lão: !!!!!!!!!!!!!!!!!!!!!!!','Truyện Cười Gia Đình');
INSERT INTO "TruyenCuoiGiaDinh" VALUES(X'','Khi biết vợ mang thai','Sau khi biết vợ mang thai

Người chồng khi biết vợ có thai thì vô cùng vui mừng. Anh muốn cho tất cả mọi người biết tin này nên lấy điện thoại của vợ nhắn tin: "Tôi đã có thai" gửi đi cho tất cả mọi người trong danh bạ.

Được một lúc thấy mẹ vợ trả lời: "Sao nói là chồng không sinh được, con lại quan hệ với thằng nào?".
Anh rể trả lời: "Cô tính xử lí thế nào?".
Tiếp theo là bạn thân bán nhắn:tao đã khuyên mày bao nhiêu lần rồi bảo đừng đi chơi bậy nữa mà mày không nghe tao, thế chồng mày biết chưa?
Tiếp theo một người bạn thân nhắn tin: "Chúng ta đã nửa năm không gặp nhau, cô đừng đổ lên đầu tôi".
Đồng nghiệp nhắn: "Không phải chứ? Mới 2 ngày mà".
Cấp trên trả lời: "Tôi cho cô 10 triệu, cô nghỉ ngơi một thời gian đi".
Khách hàng nhắn tin: "Được rồi, cô đừng hù dọa tôi, ngày mai cô tới nhà tôi, chúng ta sẽ kí hợp đồng".
Một người lạ nhắn: "Cô li dị, chúng ta sẽ giữ đứa bé".
Một người lạ khác nhắn: "Hôm đó còn có giám đốc, không phải cô tính nói là của tôi chứ?".
Và một người lạ khác nhắn: "Đừng đùa chứ, tôi đã phẫu thuật triệt sản.!!!!!!!!!!!!!!!!!!','Truyện Cười Gia Đình');
INSERT INTO "TruyenCuoiGiaDinh" VALUES(X'','Ai thảm hơn','Vào một hôm lúc nửa đêm, trong khu nghĩa địa có hai bộ xương sống lại, đi lang thang ngoài đường. Rồi bộ xương thứ nhất hỏi bộ xương thứ hai:

  - Tại sao anh chết?

Bộ xương thứ hai đáp:

  - Tôi bị xe chẹt chết. Thế còn anh thì sao?

  - Tui bị té lầu chết.

Hai bộ xương đang đi thì thấy một bộ xương tả tơi đi ngoài đường, chúng hỏi bộ xương ấy:

  - Anh bị gì mà chết thảm thế!!

Nó nói:

  - Chết ông nội tụi bây! Tao mới bị vợ đánh vì đi nhậu về nè!','Truyện Cười Gia Đình');
INSERT INTO "TruyenCuoiGiaDinh" VALUES(X'','Bố ai giỏi hơn?','Ba cậu bé nói chuyện với nhau. Cậu bé thứ nhất nói: "Bố tớ chạy nhanh nhất. Ông bắn một mũi tên và chạy về đích trước nó". 

Cậu thứ hai: - Bố tớ là thợ săn, ông bắn nhầm một phát súng vào bạn săn, sau đó còn kịp chạy đến kéo ông kia tránh viên đạn.

Cậu bé thứ ba nghe xong, bĩu môi nói: - Bố tớ là một nhân viên Nhà nước. Ông hết giờ làm việc lúc 5h chiều và về đến nhà lúc 4h15.','Truyện Cười Gia Đình');
DROP TABLE IF EXISTS "TruyenCuoiGiaoThong";
CREATE TABLE "TruyenCuoiGiaoThong" ("ImageStory" BLOB NOT NULL ,"Title" VARCHAR NOT NULL ,"Content" VARCHAR NOT NULL ,"Topic" VARCHAR DEFAULT (null) );
INSERT INTO "TruyenCuoiGiaoThong" VALUES(X'','Người thứ tư!','Một nhóm học sinh đi chung trên một chiếc xe máy, đang chạy xe trên đường thì bị cảnh sát thổi, cả nhóm dừng lại.

Cảnh sát hỏi:"Tại sao mấy đứa dám tống ba mà lại không đội nón bảo hiểm vậy hả? Có biết như vậy là vi phạm luật giao thông hay ko?" 

Cả nhóm hốt hoảng quay lại nhìn phía sau và hét lên:"Chết cha còn thằng thứ tư đâu mất tiêu rồi!!!"

Cảnh sát: !!!???Bật ngửa','Truyện Cười Giao Thông');
INSERT INTO "TruyenCuoiGiaoThong" VALUES(X'','Bể trứng','Trên xe bus, một anh chàng trông thấy có bao tải hàng nên định ngồi lên. Bỗng bà già ngồi cạnh đó hét to: "Coi chừng bể trứng!".

Anh chàng hoảng hốt hỏi lại:

- Bao này đựng trứng hả?

- Không. Sầu riêng!','Truyện Cười Giao Thông');
INSERT INTO "TruyenCuoiGiaoThong" VALUES(X'','Kẻ bị nạn','Một vụ tai nạn giao thông vừa xảy ra ngoài phố. Mọi người tò mò chen lấn vòng trong vòng ngoài để xem. Một anh đến chậm không tài nào vào xem được.

Tức quá, anh ta liền hét toáng lên:

- Tôi là bố kẻ bị nạn đây!

Mọi người kinh ngạc quay lại nhìn và vội vã giãn ra cho anh ta vào. "Kẻ bị nạn" là một... chú chó vừa bị xe cán chết.','Truyện Cười Giao Thông');
INSERT INTO "TruyenCuoiGiaoThong" VALUES(X'','Tin tốt tin xấu','Đoàn tàu kéo đẩy được đưa vào sử dụng lần đầu đang băng băng trên đường ray thì động cơ của đầu đẩy ngừng hoạt động. Người lái tàu quyết định tiếp tục hành trình với động cơ còn lại nhưng một lát sau, đầu kéo lại hỏng nốt.

Để trấn tĩnh hành khách, người lái tàu thông báo:

- Thưa quý vị! Chúng ta đang có tin tốt và tin xấu. Tin xấu là cả hai đầu máy đều đã ngừng hoạt động và chúng ta sẽ bị kẹt ở đây một thời gian. Tin tốt là phương tiện chúng ta đang sử dụng không phải một chiếc máy bay.','Truyện Cười Giao Thông');
INSERT INTO "TruyenCuoiGiaoThong" VALUES(X'','Đúng hướng','Có hai chàng trai phóng xe máy về quê. Anh chàng lái xe mặc một chiếc áo khoác len, không cúc cũng không có khoá. Cuối cùng, sau khi bị gió quất mạnh quá, anh dừng lại nói với bạn:

- Tớ không thể lái xe mà gió cứ quất vào ngực thế này, khó chịu chết đi được.

Sau một hồi suy nghĩ, anh quyết định mặc ngược áo để ngăn không cho gió quất vào ngực.

Hai người phóng nhanh, đến khi không làm chủ được tốc độ và gặp tai nạn. Bác nông dân sống gần đó thấy vậy bèn đến báo cơ sự cho cảnh sát.

- Lúc đó, bác có thấy ai có vẻ còn sống không? - Cảnh sát hỏi

- Có, có một cậu, cho tới trước khi tôi xoay cổ cậu ấy về đúng hướng.','Truyện Cười Giao Thông');
INSERT INTO "TruyenCuoiGiaoThong" VALUES(X'','Bị xe tải không người lái đâm
','Vợ lảo đảo bước vào nhà, rên rỉ:

- Anh ơi, thật khủng khiếp. Một chiếc xe tải đồ sộ đã đâm thẳng vào xe của em, làm nó bẹp rúm ró rồi!

- Ôi! Không sao, em còn lành lặn là tốt. Thế em có kịp dạy cho hắn một bài học về tốc độ không?

- Không kịp... Hắn để xe ở đấy và chuồn đi từ trước khi xe đâm nhau cơ.','Truyện Cười Giao Thông');
DROP TABLE IF EXISTS "TruyenCuoiHocDuong";
CREATE TABLE "TruyenCuoiHocDuong" ("ImageStory" BLOB NOT NULL , "Title" VARCHAR NOT NULL , "Content" VARCHAR NOT NULL , "Topic" VARCHAR DEFAULT null);
INSERT INTO "TruyenCuoiHocDuong" VALUES(X'','Học sinh thời nay','- Thầy nghĩ là ở đây không thích hợp để ngủ. Em có thể về nhà nằm ngủ được đấy!

- Thưa thầy không sao đâu ạ, chỉ mong thầy và các bạn nói nhỏ một chút!

- !!!!!','Truyện Cười Học Đường');
INSERT INTO "TruyenCuoiHocDuong" VALUES(X'','Đến thầy cũng phải điên','Thầy giáo : Em hãy cho biết Mặt Trăng xa hơn hay Mặt Trời xa hơn?
Trò : Mặt trời xa hơn ạ .
Thầy : Vì sao ?
Trò : Vì sao của Khởi My ạ
Thầy : ko, tại sao ?
Trò : Tại sao của Ưng Hoàng Phúc ạ !
Thầy : Ko , ý thầy là Why đó .!
Trò : Why ? À ! Why của DBSK .
Thầy : Trời ơi ,tôi phải làm thế nào ?
Trò : Dạ , phải làm thế nào của Wanbi ạ
Thầy : Trời ơi !!!
Trò : Trời ơi của Lê Cát Trọng lý ạ ..
Thầy : Tôi đau tim quá >.<''
Trò : Đau tim của Lâm Chấn Huy ạ
Thầy : RA Khỏi Lớp
Trò : ốồô , bài này mới ...=))','Truyện Cười Học Đường');
INSERT INTO "TruyenCuoiHocDuong" VALUES(X'','Liều mình','Một học sinh đi chơi về tuyên bố với cả phòng:

Cuối cùng rồi cũng có người con gái dám liều mình vì tao. Cả phòng nhao nhao:

- Ai vậy mày, nhỏ nào nói nghe coi?

- Nhỏ Hồng bên lớp sử chứ ai!

- Nhỏ nói gì với mày?

- Nhỏ nói “Yêu ông ư? Tui thà nhảy lầu còn hơn”.','Truyện Cười Học Đường');
DROP TABLE IF EXISTS "TruyenCuoiKhoaHoc";
CREATE TABLE "TruyenCuoiKhoaHoc" ("ImageStory" BLOB NOT NULL , "Title" VARCHAR NOT NULL , "Content" VARCHAR NOT NULL , "Topic" VARCHAR);
INSERT INTO "TruyenCuoiKhoaHoc" VALUES(X'','Im lặng là vàng','Edison phát minh một dụng cụ điện tử, ông muốn bán phát minh này với giá 3.000 USD, và tự nhủ nếu các thương gia chỉ trả 2.000 USD cũng được. Lúc gặp nhau, họ hỏi ông về giá cả, Edison lúng túng không biết phải nói như thế nào. Một người trong số họ đành phải bắt đầu trước:

- Chúng tôi không trả cao đâu, ông nghĩ sao với cái giá 40.000 USD?','Truyện Cười Khoa Học');
INSERT INTO "TruyenCuoiKhoaHoc" VALUES(X'','Như nhau cả','Một nhà khoa học tánh tình hay đa nghi, nên ông ta chế tạo ra robot phát hiện nói dối. Ngày chế tạo thành công, ông đem ra thử con trai. Cậu con trai vừa đi học về ông ta đem robot ra hỏi:
- Sao con đi học về trễ vậy?
- Con qua nhà bạn mượn sách về học.
- Robot phát hiện nói dối, đánh cho cậu con trai một cái.

Ông bố cười: Đó con thấy chưa, nói dối là phải chịu phạt. Lúc bằng tuổi con bố không dám nói dối ông nội nửa lời.
- Ngay lập tức, robot đạp ông ta một cái bay vô tường.

Người vợ thấy cậu con trai bị đánh đòn đau bèn nói: Sao anh làm thế với con, dù sao nó cũng là con anh!
- Robot nắm đầu bà vợ, đánh túi bụi.','Truyện Cười Khoa Học');
INSERT INTO "TruyenCuoiKhoaHoc" VALUES(X'','Ra đề quá khó','Tàu Discovery đang trên đường trở về trái đất từ trạm vũ trụ quốc tế Alpha, trong số bốn phi hành gia có một người da đen. Bỗng xuất hiện một chỗ hỏng ở vỏ ngoài con tàu, cần một người hy sinh leo ra khắc phục sự cố. Nhóm trưởng họp mọi người lại và tuyên bố:

- Các bạn, một người trong chúng ta phải hy sinh để chữa con tàu, riêng tôi thì không thể chỉ định ai. Vì vậy tôi sẽ tiến hành một cuộc kiểm tra kiến thức, ai không trả lời được, người đó sẽ có vinh dự được chết vì sự nghiệp chinh phục không gian của nhân loại.

Ông ta bắt đầu hỏi người thứ nhất:

- Vũ khí mà người Mỹ đã dùng để tấn công một thành phố của Nhật Bản ngày 6/8/1945 tên là gì?

- À... ờ... một trái bom nguyên tử.

- Tuyệt! Nói đoạn ông quay về phía người thứ hai, mặt đang trắng nhợt vì sợ hãi. Thế tên thành phố đó là gì?

- Người này thốt lên và thở phào nhẹ nhõm: Hiroshima.

- Vị trưởng nhóm dừng lại trước mặt phi công da đen và hỏi: Bây giờ đến lượt anh. Họ, tên, tuổi và nghề nghiệp của những nạn nhân?

- !?','Truyện Cười Khoa Học');
INSERT INTO "TruyenCuoiKhoaHoc" VALUES(X'','Tàu vũ trụ','Hai người nói chuyện với nhau về những thành tựu của nước mình.
- Sau rất nhiều chuyện, một người nói: Nước tôi đã sản xuất được tàu vũ trụ để đổ bộ lên mặt trời rồi đấy.

- Nghe vậy, người kia phản ứng lại: Bậy, mặt trời nóng như vậy thì lên làm sao được, tàu sẽ bị nóng chảy ngay lập tức!

- Người thứ nhất trả lời: Ông dốt thật, chúng tôi thừa thông minh để biết điều đó, vì vậy, chúng tôi sẽ phóng vũ trụ vào ban đêm chứ.

- ?!','Truyện Cười Khoa Học');
DROP TABLE IF EXISTS "TruyenCuoiNgheNghiep";
CREATE TABLE "TruyenCuoiNgheNghiep" ("ImageStory" BLOB NOT NULL , "Title" VARCHAR NOT NULL , "Content" VARCHAR NOT NULL , "Topic" VARCHAR);
INSERT INTO "TruyenCuoiNgheNghiep" VALUES(X'','Luật sư đi nhà hàng','Hai luật sư sau khi tham gia bào chữa tại một phiên tòa tỏ ra rất mệt nhọc, họ bước vào một quán và gọi nước uống, mỗi người lấy trong cặp của mình ra một ổ bánh mì ăn.

Anh phục vụ nhanh chóng nhắc nhở:

- Thưa quý khách, quán chúng tôi có quy định được ghi trên bản bên kia: "Quán chúng tôi có phục vụ ăn trưa. Quý khách vui lòng không ăn thức ăn tự mình mang vào quán".

Hai vị luật sư vui vẻ cám ơn anh phục vụ và trao đổi bánh mì cho nhau rồi... tiếp tục ngồi ăn ngon lành.','Truyện Cười Nghề Nghiệp');
INSERT INTO "TruyenCuoiNgheNghiep" VALUES(X'','Lời nói đáng giá','Hai cậu bé đang khoe khoang về bố mình, đứa thứ nhất nói: "Bố tao chỉ cần nói một câu là tòa án giảm những 5 năm tù cho tù nhân đấy".
Đứa thứ hai nói:

- Thế thì có nhằm nhò gì bố tao nói một câu là tù nhân không phải ở tù ngày nào.

- Bố mày nói câu gì hay vậy?

- Đề nghị tử hình.

- !!!!!','Truyện Cười Nghề Nghiệp');
