INSERT INTO "TruyenCuoiTheThao" VALUES(X'','Ai lười hơn','Trong buổi lao động, học sinh tham gia chuyển gạch để xây tường. Thấy Ân một chuyến chỉ mang một viên gạch, trong khi mọi bạn khác đều mang hai viên, một bạn liền hỏi:

- Ân lười quá, mang được mỗi một viên gạch.

Ân liền cãi:

- Có bạn lười thì có.

Mọi người cười ồ. Ân nói tiếp:

- Các bạn sợ phải đi hai chuyến nên mới mang hai viên một lần chứ còn gì nữa.','Truyện Cười Thể Thao');
INSERT INTO "TruyenCuoiTheThao" VALUES(X'','Đi và về','Một ông lão từng là cua-rơ chạy đua khoe với các cua-rơ cháu chắt về thời vàng son oanh liệt của mình:

- Ta còn nhớ hồi còn trẻ, ta đã chạy bộ 50 cây số để cho cái thằng cướp người tình ta một cái bợp tai.

- Thế sau đó, ông cũng lại chạy bộ về à?

- Không! Ta về bằng... xe cứu thương','Truyện Cười Thể Thao');
INSERT INTO "TruyenCuoiTheThao" VALUES(X'','Thành công','Đội bơi lội tỉnh nọ vừa đi thi đấu về, huấn luyện viên long trọng phát biểu:

- Tuy chúng tôi không đạt một thắng lợi nào, nhưng thay vào đó không ai bị chết đuối và điều đó đã là thành công lắm rồi!','Truyện Cười Thể Thao');
INSERT INTO "TruyenCuoiTheThao" VALUES(X'','Mất hay không?','Tên trộm lẻn vào nhà dắt chiếc xe @ mới cứng ra cửa, chợt nghe tiếng ông chủ nhà thét lên: Việt vị! việt vị rồi! Tiếc quá!...

- Tên trộm máu mê bóng đá không kìm được bật lên tiếng cãi: Việt vị đâu mà việt vị nào?

- Ông chủ nhà không buồn để ý đến tiếng ai vừa nói, vẫn dán mắt vào màn hình chăm chú và ra giọng cá cược: Được rồi, nếu không phải là việt vị, tôi sẽ mất cho anh cái @!

- !!!','Truyện Cười Thể Thao');
INSERT INTO "TruyenCuoiTheThao" VALUES(X'','Chạy nước rút vào...bệnh viện','Một cựu vô địch môn chạy việt dã khoe với con cháu về thời vàng son oanh liệt của mình:

- Hồi còn trẻ, ta đã chạy nước rút 50 cây số để cho cái thằng xúc phạm người tình của ta một bợp tai.

- Rồi sau đó ông lại chạy "nước rút" về à?

- Ta cũng không nhớ! Chỉ biết rằng khi tỉnh lại, ta đã thấy mình ở trong bệnh viện rồi.','Truyện Cười Thể Thao');
DROP TABLE IF EXISTS "TruyenCuoiTinhYeu";
CREATE TABLE "TruyenCuoiTinhYeu" ("ImageStory" BLOB NOT NULL , "Title" VARCHAR NOT NULL , "Content" VARCHAR NOT NULL , "Topic" VARCHAR);
INSERT INTO "TruyenCuoiTinhYeu" VALUES('','Tin nhắn','Có một chàng trai yêu đơn phương một cô gái nhưng không dám nói ra.

Một ngày kia, lấy hết can đảm, chàng soạn một tin nhắn tỏ tình và nhấn send lúc 1h sáng. Tin nhắn trả lời đến ngay sau đó, nhưng chàng trai quyết định để ngày hôm sau sẽ đọc.

Sáng hôm sau, chàng trai mở tin nhắn lên và… shock.

.
.
.
.
.
.
.
.
”Tài khoản của quí khách không đủ để gửi tin nhắn,xin vui lòng nạp thêm”','Truyện Cười Tình Yêu');
INSERT INTO "TruyenCuoiTinhYeu" VALUES('','Tại sao Ế','- Ế đang là một xu thế của quốc tế trong khi nền kinh tế rất chi lề mề và trì trệ, còn lạm phát thì cao hơn điện thế.

- Ế là phong cách sống của các con người tinh tế và các bậc vai vế, chỉ thích ngồi trên ghế, nhâm nhi cafe, chơi đế chế hoặc nghịch dế.

- Ế là một lợi thế để chúng ta bàn mưu tính kế, xoay chuyển tình thế, quản lý tiền tệ... Rồi 1 ngày kinh tế sẽ đủ sức khống chế tình yêu.

- Ế cũng cần phải có trí tuệ, để khi bạn bè trêu mình là ế, mình cũng đủ sức chống chế: "Tao ế là vì tao sống quá tử tế mà thôi."

- Khi ế ta cũng chả sợ yêu nhầm 1 đứa dở tệ (hay là pê đê) để sau này người mình yêu không phải ê chề và rơi lệ.

- Tóm lại, ngắn gọn 1 câu: "Ế là một phong cách sống cực kỳ tinh tế" :))','Truyện Cười Tình Yêu');
INSERT INTO "TruyenCuoiTinhYeu" VALUES('','Tuyệt chiêu','Cô gái đi học trên Hà Nội, nửa đêm nhận được tin nhắn: “Chào em, mình làm quen được không? Em có người yêu chưa?”

- Em có rồi anh ạ!

- Thế á, cha mày đây, sớm mai bắt xe về quê ngay họp gia đình chuyện này!

Hôm sau cô gái nhất quyết không về, nửa đêm lại có tin nhắn:

- Anh phải làm sao để được làm bạn em? Cho phép anh làm quen nhá! Em có người yêu chưa?

- Em chưa!

- Em làm anh thất vọng quá, một phép thử đơn giản là biết được lòng nhau ngay, mình chia tay thôi!

- Ôi em xin lỗi, em tưởng ông già em, cho e một lời giải thích.

- Giải thích gì? Ông già mày đây, mai không về quê thì đừng về nữa! Gọi cả thằng đó về cho tao!','Truyện Cười Tình Yêu');
INSERT INTO "TruyenCuoiTinhYeu" VALUES('','Bàn luận về tình yêu','Các bác sĩ cho rằng: "Tình yêu là căn bệnh, cần chữa trị bệnh nhân bằng chế độ nằm giường".

Nhà vật lý: Sao lại gọi tình yêu là căn bệnh được khi mà nó tiêu hao năng lượng nhiều như thế. Phải gọi tình yêu là hoạt động.

Nhà cơ học: Sao lại gọi tình yêu là hoạt động được, khi mà tổ hợp máy chính vẫn đứng yên? Phải gọi tình yêu là nghệ thuật.

Nhà nghiên cứu nghệ thuật: Sao lại gọi tình yêu là nghệ thuật khi mà ai cũng e ngại phô ra cho người khác xem? Phải nói tình yêu là trò gian lận.

Luật gia: Sao gọi tình yêu là trò gian lận khi mà hai phía đều thỏa mãn. Phải nói tình yêu là hợp đồng sản xuất.

Nhà doanh nghiệp: Sao lại gọi tình yêu là hợp đồng sản xuất được khi mà chi phí tốn kém nhiều hơn giá trị sản phẩm cuối cùng. Phải nói tình yêu là khoa học.

Giáo sư: Sao gọi tình yêu là khoa học được khi mà đám sinh viên làm được còn tôi thì không?','Truyện Cười Tình Yêu');
DROP TABLE IF EXISTS "TruyenCuoiYHoc";
CREATE TABLE "TruyenCuoiYHoc" ("ImageStory" BLOB NOT NULL , "Title" VARCHAR NOT NULL , "Content" VARCHAR NOT NULL , "Topic" VARCHAR);
INSERT INTO "TruyenCuoiYHoc" VALUES(X'','Chuyển hướng điều trị','Bác sĩ nói với bệnh nhân: "Ông bị cảm cúm, nên kiên nhẫn chờ khỏi bệnh. Mùa đông người ta dễ bị cảm mà chả có thuốc gì chữa khỏi"
Bệnh nhân sốt ruột:
- Nhưng ông phải khuyên tôi làm gì đó chứ?
- Ông thử tắm nước lạnh chừng nửa giờ, quấn khăn mỏng ngang bụng chạy ngoài trời khoảng vài chục phút...
- Thế thì tôi sưng phổi mất còn gì?
- Sưng phổi thì sẽ có thuốc trị.','Truyện Cười Y Học');
INSERT INTO "TruyenCuoiYHoc" VALUES(X'','Bán thuốc theo toa','Một phụ nữ bước vào hiệu thuốc và hỏi mua một liều thuốc ngủ cực mạnh. Người bán cẩn thận hỏi: "Bà mua thuốc này làm gì vậy?"

- Để giết chồng tôi.

- Tôi không thể bán thuốc cho bà để giết chồng được!

Người đàn bà bèn đưa ra một bức ảnh người đàn ông và một phụ nữ trong tư thế thân mật. Người đàn ông là chồng bà, còn người phụ nữ lại chính là vợ của người bán thuốc.

Người bán thuốc cầm lấy bức ảnh và gật đầu:

- Xin lỗi! Tôi không biết là bà có mang toa thuốc theo.

','Truyện Cười Y Học');
INSERT INTO "TruyenCuoiYHoc" VALUES(X'','Thôi miên liệu pháp','Một bà nọ mắc chứng rối loạn tuần hoàn chữa trị bằng nhiều loại thuốc men mãi không khỏi. Nghe nói bệnh này có thể điều trị bằng thôi miên, bà cũng thử xem sao.

Ông thày thôi miên nhìn xoáy sâu vào mắt bệnh nhân và bảo:

- Bà hãy nhắc lại từng lời tôi nói: "Tôi đã khỏi bệnh! Đã khỏi bệnh!"

Người bệnh mừng rỡ reo lên:

- Tôi đã khỏi bệnh!

- Bà phải trả tôi 500 đôla! - Ông thày thôi miên nói.

Bà bệnh nhân liền nhìn sâu vào mắt người vừa điều trị cho mình, niệm thần chú:

- Tôi đã trả tiền rồi. Thày hãy nói theo: "Vâng! Bà đã trả tiền rồi!".','Truyện Cười Y Học');
